import axios from 'axios'
import React from 'react'
import { useState, useEffect } from 'react'
// import {Link} from 'react-router-dom'

const URI = 'http://localhost:1337/'

const ShowSearch = () => {
    <h1>HELLOOOOO</h1>

    const [data, setData] = useState([]);
    useEffect( () => {
        fetch('/')
      .then(res => res.json())
      .then(setData);
    }, [])

    // //Funcion para obtener los datos de la DB
    // const getData = async () => {
    //     const res = await axios.get(URI)
    //     setData(res.data)
    // }

    return(
        <table>
            <thead>
                <tr>
                    <th>nombre</th>
                    <th>numero</th>
                    <th>expediente</th>
                </tr>
                
            </thead>
            <tbody>
                {data.map ((data) => (
                    <tr key={data.id}>
                        <td> {data.nombre} </td>
                        <td> {data.numero} </td>
                        <td> {data.expediente} </td>
                    </tr>

                ))}

            </tbody>
        </table>

    )
}

export default ShowSearch;
